(3, 3, 11, 'Doru bácsi!', '2016-09-14 07:36:03', '2016-09-14 07:36:03'),
(4, 3, 11, 'Lesz fuvar a 312XG megrendeléshez? Ha igen, kitől és mikorra? Nem töltötte ki az ERP-ben az infokat!', '2016-09-14 07:36:44', '2016-09-14 07:36:44'),
(5, 3, 7, 'Fiam, nyugodj le, minden rendben van.', '2016-09-14 07:37:31', '2016-09-14 07:37:31'),
(6, 3, 11, 'OK. Köszönöm!', '2016-09-14 07:38:23', '2016-09-14 07:38:23'),
(7, 4, 11, 'Helyzet? Foci mikor lesz?', '2016-09-14 07:44:32', '2016-09-14 07:44:32'),
(8, 5, 11, 'Szia!', '2016-09-29 08:15:58', '2016-09-29 08:15:58'),
(9, 5, 11, 'Lesz egy rendszeren belüli levelező is.... úgyis (elvileg) futni fog mindenkinél mindig az ERP', '2016-09-29 08:16:22', '2016-09-29 08:16:22'),
(10, 6, 11, 'Szia. Létrehoztam a Renoma klinest.', '2017-01-16 09:52:11', '2017-01-16 09:52:11');
